import React,{useState,useEffect} from "react";

import getToDos from "../helpers/getToDos";


// react component - todos del usuario 
export default function ToDosUsuario(props){
    // usuario traido desde las props;
    let u = props.usuario;

    const [todos,setTodos] = useState([]);
    useEffect( () => handleTodo(),[])

    const handleTodo = () => {
        //todo generico
        console.log(u.userId);
        const todoInicial = {
            id:99,
            todo:"contenido generico",
            completed:true,
            userId:1
        }
        setTodos([todoInicial]);

    }
    return(
        <div>
            <h1> Mis To Dos ... </h1>
            <ul>
            {todos.map((todo) => (
                <div>
                    <li key={todo.id} >{todo.todo} </li>
                </div>

            ))}
            </ul>

        </div>
    )
}

